            <img src="https://my-travel-diary.by/wp-content/uploads/2021/05/%D0%9A%D0%BE%D0%BD%D0%B8-%D0%BF%D0%BE%D0%BD%D0%B8.jpg" alt="" srcset="" />
        </div>
    )
}
